If(
    ThisItem.MenuLabel = "Dashboard",
    Set(
        varVisDash,
        true
    );
    Set(
        varVisKanban,
        false
    );
    Set(
        varVisPlutus,
        false
    )
    ,
        ThisItem.MenuLabel = "Plutus",
    Set(
        varVisDash,
        false
    );
    Set(
        varVisKanban,
        false
    );
    Set(
        varVisPlutus,
        true
    ),
        ThisItem.MenuLabel = "Kanban",
    Set(
        varVisDash,
        false
    );
    Set(
        varVisKanban,
        true
    );
    Set(
        varVisPlutus,
        false
    )
    ,
    ""
)

